import React from 'react';
import './About.css';
import Matt from '../Images/matt.jpg';


const About = () => {
    return (

        <div class="row">
            <div class="row row3">
                <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/4.4.1/css/bootstrap.min.css" integrity="sha384-Vkoo8x4CGsO3+Hhxv8T/Q5PaXtkKtu6ug5TOeNV6gBiFeWPGFN9MuhOf23Q9Ifjh" crossorigin="anonymous"/>
                <div class="col-md-12 contentbox">
                    <img class="matt" src={Matt} alt="Matt at Work" />
                    <div class = "headerBox">
                        <p class= "header">Full Stack Web Developer & Web Designer based in Seattle, WA</p>
                        <p class = "header">Highly experienced in designing and developing custom websites and applications</p>
                    </div>
                </div>
            </div>
                <div class="row row4">
                    <div class="col-md-12 contentbox">
                        <p class = "content">I was born and raised in the Pacific Northwest, and attained a bachelors degree in Political Science from Western Washington University. 
                        Upon graduating I got a job at Costco Travel, and then worked as a Tax Accountant for a few years before joining the International Buying Office in 2018. 
                        In the past year I have completed the Coding Boot Camp through the University of Washington Professional and Continuing Education Dept, and am now looking to apply these skills in a new career.</p> 
                    </div>
                </div>
        </div>


    );
}

export default About;
